import axios from "axios";
import { useState, useEffect } from "react";

export default function Movies() {
  const [trendingMovies, setTrendingMovies] = useState([]);

  let getTrendingMovies = async () => {
    let { data } = await axios.get(
      "https://api.themoviedb.org/3/trending/movie/day?api_key=df0aad8d17f69e36bdd1a3de0d77194f"
    );
    setTrendingMovies(data.results);
  };

  useEffect(() => {
    getTrendingMovies();
  }, []);

  return (
    <>
      <div className="row py-4 gy-3">
        <div className="col-md-4">
          <div className='bordr w-25 mb-3'> </div>
          <h3>Trending</h3>
          <h3>Movies</h3>
          <h3>To watch Now</h3>
          <p className="text-muted mb-3">most watched movies by day</p>
          <div className='bordr '></div>
        </div>
        {trendingMovies.slice(0, 10).map((item, index) => (
          <div className="col-md-2" key={index}>

          </div>
        ))}
      </div>
    </>
  );
}
